import React from "react";
import SideBar from "./SideBar";
import '../style.css';
import Dashboard from "./Dashboard";
import { Switch } from "@material-ui/core";
function HomePage(){
    return(
        <>
        <div className="container-bg">
                <div className="left">
                    <SideBar/>
                </div>
                <div className="right">
                    <Switch>
                        <Route path="/">
                            <Dashboard/>
                        </Route>
                        <Route path="/import">
                            <Import/>
                        </Route>
                    </Switch>
                    
                </div>
            </div>
        
        </>
    );
}
export default HomePage;
